import React from 'react';
import ReactDOM from 'react-dom';


let time = new Date().toLocaleDateString()
let str = '当前时间是'
let element = (
  <div>
    <h1>hello world</h1>
    <h2>{str + time}</h2>
  </div>
)

ReactDOM.render(
  element,
  document.getElementById('root')
)
